'use strict';
class PriceHistoryItem {
    date;
    bidOpen;
    bidClose;
    bidHigh;
    bidLow;
    askOpen;
    askClose;
    askHigh;
    askLow;
    volume;
    getDate() {
        return this.date;
    }
    getBidOpen() {
        return this.bidOpen;
    }
    getBidClose() {
        return this.bidClose;
    }
    getBidHigh() {
        return this.bidHigh;
    }
    getBidLow() {
        return this.bidLow;
    }
    getAskOpen() {
        return this.askOpen;
    }
    getAskClose() {
        return this.askClose;
    }
    getAskHigh() {
        return this.askHigh;
    }
    getAskLow() {
        return this.askLow;
    }
    getVolume() {
        return this.volume;
    }
}
module.exports = PriceHistoryItem
